var tipuesearch = {"pages": [{'title': 'About', 'text': '第 1 組成員: 40523120 倉儲 \xa0 | \xa0 40523120 網站 40723102 倉儲 \xa0 | \xa0 40723102 網站 40723110 倉儲 \xa0 | \xa0 40723110 網站 40723112 倉儲 \xa0 | \xa0 40723112 網站 40723115 倉儲 \xa0 | \xa0 40723115 網站 40723120 倉儲 \xa0 | \xa0 40723120 網站 40723127 倉儲 \xa0 | \xa0 40723127 網站 40723136 倉儲 \xa0 | \xa0 40723136 網站 40723140 倉儲 \xa0 | \xa0 40723140 網站 40723143 倉儲 \xa0 | \xa0 40723143 網站 40723146 倉儲 \xa0 | \xa0 40723146 網站 40723148 倉儲 \xa0 | \xa0 40723148 網站 \n', 'tags': '', 'url': 'About.html'}, {'title': '每周任務', 'text': '', 'tags': '', 'url': '每周任務.html'}, {'title': 'Week10', 'text': '啟動分組程序 \n 分配組員工作 \n ---------------------------------------------- \n 1 . 以分組協同方式整理教科書內容 \n 2 .\xa0 處理 content.htm, reveal 簡報以及 pelican 網誌 markdown 中的改版衝突 \n 3 . NX及SolveSpace 繪圖\xa0 \n 4 . V-rep 與 Webots Tutorial, 分別利用 Solvespace 與 NX 建立零組件轉入 \n', 'tags': '', 'url': 'Week10.html'}, {'title': 'Week12', 'text': '1.NX 零組件繪圖 \n 2.Webots 與 V-rep Tutorial \n ---------------------------------------------------- \n 1 . 分別用 Solvespace\xa0 \xa0和\xa0 NX 建立零組件，錄製繪圖過程並建構出零組件後與V-REP、Webots組做 結合。 \n 2 .\xa0 NX繪圖者匯出零件後分析零件應力分析，再和Webots的應力分析做比較，得出差異性。', 'tags': '', 'url': 'Week12.html'}, {'title': '模擬', 'text': '', 'tags': '', 'url': '模擬.html'}, {'title': 'Webots', 'text': '', 'tags': '', 'url': 'Webots.html'}, {'title': 'V-rep', 'text': '', 'tags': '', 'url': 'V-rep.html'}, {'title': '繪圖', 'text': '\n', 'tags': '', 'url': '繪圖.html'}, {'title': 'Inventor 2019', 'text': '', 'tags': '', 'url': 'Inventor 2019.html'}, {'title': 'NX 12', 'text': '\xa0NX歷史 \n \xa0 NX源自於美國麥道航太公司，近30年的資深CAD / CAM / CAE系統，再加上西門子在系統與設備，工程上的經驗與能力提供在加工與產品開發設計上更多的資源與整合。 \n 在CAM加工上智慧模型（MasterModel）的概念，至少包含3DCAD模型，與NC路徑的完整關聯性，並替換數據大小以及刀具路徑的管理，在高速切銷加工上提供穩定可靠與加工品質，同時針對複合銑削加工的領域提供完整的解決方案。 \n NX優點 \xa0 NX讓客戶增加新產品數量，減少30％以上的開發時間，縮短70％以上的設計分析重複作業，並減少高達90％的電腦數控（CNC）編程時間。 \n CAD   \xa0• 從零件設計資料輸入開始，通常是3D CAD模型，某些情況下也可能是2D圖面。通常會需要用到3D CAD軟體以準備或調整零件設計模型，進行後續的NC編程操作。 \n CAM   \xa0• NX CAM包含NC編程，後處理及工具機模擬。 \xa0• 功能完備的套件Siemens是進階工具機控制器技術及驅動設備領域的公認領導廠商。 \n NX CAD / CAM一體化的優勢 \xa0• 3D零件建模準備NX最新的CAD技術能夠NC程序設計師迅速準備零件模型，包括協力廠商的CAD模型。只要利用同步建模技術，就可以直接編輯零件模型，準備讓零件進入NC編程。 \n \xa0• NX提供一組專門的CAD功能，讓NC程序設計師能夠在建立NC操作之前快速進行分析。 \n \xa0•\xa0 建模，組立件與製圖-NX提供了當今市場上最強大的CAD功能組合。這些功能已替換NX CAM之中，且有需要的NC程序設計師使用建立零件，坯件形狀，夾治具或工具機模型以進行模擬 。 CAD-CAM-CNC流程鏈 \n', 'tags': '', 'url': 'NX 12.html'}, {'title': 'Solidworks', 'text': 'soliworks\xa0 brief\xa0 history \n \xa0 \xa0 \xa0 \xa0 Soliworks是由Jon Hirschtick於1993年12月創立的，Jon Hirschtick用100萬美元成立了該公司。 之後Hirschtick招募了一組工程師，他們的目標是創建3D CAD軟件，並且希望這個軟體能夠讓Windows系統的介面成功運作並適合Windows去利用。 \n \xa0 \xa0 \xa0 \xa0 1995年11月，SolidWorks很快發布了。它是Windows的第一個而且也很重要的建模器。事實證明這是CAD後續發展的重要一步，雖然AutoCAD發行得比Soliworks早得多，但SolidWorks為也帶來了新的東西-「3D建模」。因此，3D CAD成為1990年代的焦點。在短短幾個月內，SolidWorks改變了工程師將「創造變為現實」的方式。 \n \xa0 \xa0 \xa0 \xa0 SolidWorks實在令人印象深刻，以至於1997年，它被達索系統公司（DassaultSystèmes）以3.2億美元的驚人股票收購，Jon Hirschtick在接下來的14年留任，在他的領導下，SolidWorks也成功的成長為收入達1億美元的公司。 赫希提克後來離開，創立了另一家我們熟悉的公司Onshape。 \n \xa0 \xa0 \xa0 \xa0\xa0\xa0當SolidWorks於1995年首次發佈時，它確實改變了遊戲規則，有了它，首選平台就從UNIX轉移到了PC， 軟件的成本也從18,000美元變到4,000美元，所需的培訓被大量壓縮為幾天。不用說，SolidWorks徹底改變了每個工程師的桌面。自成立以來，SolidWorks已有了26個版本，每個版本都提供更多功能和增強功能。 \n Soliworks practice \n https://www.youtube.com/watch?v=ZkHTpLE2LiQ \n', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'Creo 6.0', 'text': '', 'tags': '', 'url': 'Creo 6.0.html'}, {'title': 'Onshape', 'text': '', 'tags': '', 'url': 'Onshape.html'}]};